import { createSlice,createAsyncThunk } from "@reduxjs/toolkit";

const fetchMusic=createAsyncThunk("music/fetchmusic",async()=>{
  const res= await fetch('../../Allindexs/Music/Musicdata.json')
  const data=await res.json();
  return data;
})
export const MuiscSlice=createSlice({
  initialState:[],
  name:'MuiscSlice',
  extraReducers:(builder)=>{
    builder.addCase(fetchMusic.fulfilled,(state,action)=>{
      return action.payload;
    })
  }
})
